abstracts.content:
Celem prezentowanego opracowania jest ocena skali obciążenia gospodarek UE konsekwencjami chorób przewlekłych w kontekście ograniczeń w potencjale rynków pracy krajów członkowskich. Utracony potencjał zasobów pracy przedstawiono wykorzystując wskaźniki określające liczbę utraconych w wyniku chorób przewlekłych lat życia w tzw.  zdrowiu” osób w wieku produkcyjnym. Szczególną uwagę skupiono na problemie istniejących nierówności w poziomie obciążenia skutkami chorób przewlekłych oberwanych w relacji stara i nowa Unia, a następnie dokonano oceny zachodzących w tym obszarze procesów konwergencji. Obszarem analizy w niniejszym opracowaniu objęto następujące zagadnienia:
— skala i tendencje zmian w poziomie obciążenia demograficznego na obszarze UE-27 ze szczególnym uwzględnieniem długoterminowych prognoz odnoszących się do potencjału zasobów pracy;
— skala i tendencje zmian w poziomie obciążenia konsekwencjami złego stanu zdrowia zasobów pracy w UE-27 w perspektywie rosnącego zagrożenia długookresowymi konsekwencjami chorób przewlekłych, w tym ocena skali nierówności obserwowanych w tym zakresie miedzy krajami starej i nowej Unii;
— procesy konwergencji zachodzące w grupie krajów UE-27 w poziomie obciążenia osób w wieku produkcyjnym konsekwencjami chorób przewlekłych jako efekt społecznej państw członkowskich skupiającej się na poprawie warunków pracy i poziomu życia mieszkańców.
Analizę poziomu obciążenia zasobów pracy UE-27 konsekwencjami procesów demograficznych oparto o dane Eurostat, w tym dostępne wyniki prognozy demograficznej oczekiwanej w 2100 roku struktury populacji UE. Dokonano oceny rozkładu przestrzennego tych wskaźników w odniesieniu do obszaru UE-27. Porównywalność danych między państwami członkowskimi UE-27 została osiągnięta dzięki zastosowaniu wskaźników intensywności odnoszących liczbę zaobserwowanych przypadków na określoną wielkość populacji. Skala obciążenia gospodarek unijnych długookresowymi konsekwencjami chorób przewlekłych wyrażona została wskaźnikami określającymi liczbę utraconych w następstwie określonej choroby lat zdrowego życia w wyniku przedwczesnej śmierci (years of life lost — YLLs) lub niepełnosprawności (years lost to disability — YLDs) opracowanymi w oparciu o dane Światowej Organizacji Zdrowia. Na potrzeby zaplanowanej oceny oddziaływania poziomu rozwoju gospodarczego zdeterminowanego okresem transformacji na obserwowaną skale dysproporcji w stanie zdrowia mieszkańców Unii w relacji „stara-nowa” UE obserwowanych w wyodrębnionych grupach wiekowych wyróżniono dwie grupy państw: (l) UE-14 państwa reprezentujące wysoko rozwinięte
gospodarki o tradycjach rynkowych przyjęte w skład Unii do roku 2004 (bez Wielkiej Brytanii) oraz (2) UE-CEE kraje Europy Środowej i Wschodniej przyjęte w struktury UE po roku 2004 z doświadczeniami transformacji ustrojowej. Założony pomiar kongregacji, zachodzącej w grupie krajów UE-27 w poziomie obciążenia osób w wieku produkcyjnym konsekwencjami chorób przewlekłych mierzonych liczbą utraconych lat życia (YLLS) lub zdrowia (YLDS), wpisuje się w nurt oceny tzw. konwergencji społecznej państw członkowskich skupiającej się na poprawie warunków pracy i poziomu życia mieszkańców.
